define('fc/wa',['jquery'],function($){var module={};function share_click(e){e.preventDefault();module.share($(this));}
module.init=function($parent){if(!$parent){$parent=$(document);}
$parent.find('.whatsapp-publish').off('click',share_click).on('click',share_click);};module.share=function(ele){data={};if(ele.attr('href')&&ele.attr('href').length>0){data['url']=ele.attr('href');}
else{data['url']=ele.data('link');}
var wa_url=ele.data('share-url');if(wa_url){_gaq.push(['_trackSocial','Whatsapp','share',data['url']]);window.location=wa_url;}};return module;});